'use strict';

// Supported events that RenderLayer's can subscribe to.

module.exports = {
  onTouchStart: 'touchstart',
  onTouchMove: 'touchmove',
  onTouchEnd: 'touchend',
  onTouchCancel: 'touchcancel',
  onClick: 'click',
  onContextMenu: 'contextmenu',
  onDoubleClick: 'dblclick'
};
